import React from 'react';
import {HashRouter, Route, Switch} from 'react-router-dom';
import Xiaojj from './Xiaojj';
import App from './App';


const BasicRoute = () => (
    <BrowserRouter>
      <div>
      <Route path="/" exact component={Xiaojj} />
      <Route path="/app" component={App} />
    </div>
    </BrowserRouter>
  )


export default BasicRoute;
